import Head from "next/head";
import Container from "./components/Container";

const Index = () => {
  return (
    <div>
      <Head>
        <title>Home Index</title>
      </Head>
      <Container>
        <h1>Index</h1>
      </Container>
    </div>
  );
};

export default Index;
